import React, {Component}from 'react';
import{Link} from'react-router-dom';
import {render}from'react-dom';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faHeadset, faUser} from '@fortawesome/free-solid-svg-icons';
import Cookies from 'universal-cookie';



const cookies = new Cookies();


export default class Navigation extends Component {

    componentDidMount() {
        if(!cookies.get('nombre')){
            window.location.href='/'
        }
    }

    render() {
        return(
                <div>
                    <nav className="navbar navbar-expand-lg navbar-light bg-dark">
                        <Link className="navbar-brand text-white" to="/">TAREAS DEL DIA</Link>
                        <button className="navbar-toggler bg-white" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className=" collapse navbar-collapse" id="navbarNav">
                            <ul className=" navbar-nav">
                                <li className="nav-item active">
                                    <Link className="nav-link text-white" to="/">Home</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link text-white"  to="/adminTask">Talleres</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link text-white"  to="/adminAreas">Areas</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link text-white" to="/adminUsers">Users</Link>
                                </li>

                            </ul>
                            <ul className="navbar-nav ml-auto">
                                <FontAwesomeIcon icon={faHeadset} style={{fontSize: 30}}/>
                                <a className="nav-link support text-white mr-4" href="" data-toggle="#" data-target="#">Soporte</a>   

                                <FontAwesomeIcon icon={faUser}  style={{fontSize: 30}}/>
                                <li className="nav-item dropdown ">
                                    <a className="nav-link dropdown-toggle text-white" id="navbarDropdown" role="button" data-toggle="dropdown" aria-expanded="true" aria-haspopup="true"><span className="text-white">{cookies.get('nombre')} </span><span className="text-white">{cookies.get('apellido')}</span></a>
                                    <div className="dropdown-menu navbar-light bg-dark " aria-labelledby="navbarDropdown" id="subMenu">

                                        <a id="idAprobados2" className=" dropdown-item " href="#">Resultados</a>                               
                                        <a className=" dropdown-item" href="#">Usuarios</a>

                                        <div className="dropdown-divider"></div>
                                        <a className=" dropdown-item" href="#">LogOut</a> 
                                    </div>

                                </li>


                            </ul>
                        </div>
                    </nav>


                </div>
                );
    }
    ;
}
;
